  [],\n\t\"revision_timestamp\": \"2015-09-26T22:06:53.902910\",\n\t\"name\": \"u-s-coastal-lidar-elevation-data-including-the-great-lakes-and-territories-1996-present\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Coastal Services Center manages
  and distributes lidar data for the coastal United States, including territorial
  possessions via the Digital Coast Data Access Viewer web-mapping application. The
  data span from the mid-1990's to the present and were collected using several different
  sensors. The collection includes data from topographic and bathymetric lidar sensors.
  Data are available for shoreline strips to full county coverage and larger. The
  products have been delivered to the CSC in various formats, projections, datums,
  and units. Once received, the data are reviewed, checked for errors, and standardized
  in a single format, projection, and datum. The NOAA National Geophysical Data Center
  serves as the long-term archive of these data.\",\n\t\"license_title\": null,\n\t\"extras\":
